import React, {Component} from 'react';
import Home from "./home";
import Member from './member';
import Timeline from './timeline';
import UploadPost from './upload_post';
import Contact from './contact';
import {Route, NavLink, HashRouter} from 'react-router-dom';
import { Navbar, Nav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap';

class MainContainer extends Component {
    state={
        nick: ""
    }
    render(){
        return(
            <div>
                <HashRouter>
                    <Navbar bg="light" variant="light">
                        <Navbar.Brand exact to ="#">우리들의 Blind</Navbar.Brand>
                        <Nav className="mr-auto">
                            <NavLink exact to='/'>Home</NavLink>
                            {/* <NavLink to='/timeline'>타임라인</NavLink> */}
                            <Nav.Link to='/timeline'>타임라인</Nav.Link>
                            <NavLink to='/post'>포스트 등록</NavLink>
                            <NavLink to='/member'>로그인</NavLink>
                            <NavDropdown title="Enjoy" id="basic-nav-dropdown">
                                <NavDropdown.Item>회원정보</NavDropdown.Item>
                                <NavDropdown.Item>쪽지함</NavDropdown.Item>
                            </NavDropdown>
                            <NavLink to='/contact'>Contact</NavLink>
                        </Nav>
                        <Navbar.Text>{this.state.nick}</Navbar.Text>
                        <Form inline>
                            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                            <Button variant="outline-primary">Search</Button>
                        </Form>
                    </Navbar>
                        <div className="content">
                            <Route exact path='/' component={Home} />
                            <Route path='/member' component={Member} />
                            <Route path='/post' component={UploadPost}/>
                            <Route path='/timeline' component={Timeline} />
                            <Route path='/contact' component={Contact} />
                        </div>
                    
                </HashRouter>
            </div>
        );
    }
}

export default MainContainer;
